import React, { Component } from "react"

export default class Dog extends Component {
    constructor() {
        super()
        this.state = {
            allPups: []
        }
    }

    displayPupNames = () => {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                this.setState({ allPups: pups })
            })

    }


    render() {
        return (

            <span>{this.state.allPups[0].name}</span>
        )
    }
}
